import React, { Component } from 'react';

class Display extends Component {
    render () {
        const text = this.props.text;
        return(

            <button className = {this.props.classes} text = {this.props.text} onClick = {this.props.updateDisplay.bind(this, text)}>{this.props.text}</button>
        )
    }
}

export default Display;
